class Teams {
    constructor(){
        this.team = new Map()
    }

    set(teamx){
        this.team.set(teamx.name, teamx)
    }

    get(name){
        return this.team.get(name)
    }

    delete(name){
        this.team.delete(name)
    }

    createTeam(name, descr, img, date, soccers,clasified){
        let newTeam = new Team(name, descr, img, date, null,clasified)
        newTeam.soccers = new Map()
        this.set(newTeam)
    }

    addSoccer(nameTeam, nameSoccer, ageSoccer, imgSoccer){
        let newSoccer = new Soccer(nameSoccer,ageSoccer,imgSoccer)
        this.team.get(nameTeam).soccers.set(newSoccer.name,newSoccer)
    }

    has(key){
        return this.team.has(key)
    }

}

var teams = new Teams()

class Team {
    constructor(name, descr, img, date, soccers,clasified) {
        this.name = name
        this.descr = descr
        this.img = img
        this.date = date
        this.clasified = clasified
        if (soccers === null || soccers === undefined) {
            this.soccers = []
        } else {
            this.soccers = soccers
        }
    }
}

class Soccer {
    constructor(name, age, img) {
        this.name = name
        this.age = age
        this.img = img
    }
}

